INSERT INTO `vdescriptions` VALUES ('LHA1002','Piso en la 1ª planta de edificio situado en el barrio de la Trinidad, en el centro de Málaga, junto al río Guadalmedina. Está en perfectas condiciones. Dicha propiedad se compone de un amplio y luminoso salón con balcón, cuatro dormitorios, estando el principal completamente insonorizado, y uno de ellos habilitado como despacho para teletrabajo; cocina amueblada con acceso a un patio propio con barbacoa y una habitación de lavado y plancha; dos baños, uno de ellos con bañera de esquina y muy amplio. Todo exterior. El edificio posee zonas comunes de acceso para todos los vecinos, con ascensor que cubre desde la entreplanta hasta la tercera planta. El suministro de agua es comunitario, y la calle está habilitada con fibra para internet de gran velocidad. Situado a 270 m. de supermercado Mercadona, a 286 m. de la Plaza Bailén, y 400 m. del Hospital Civil. Paradas de autobuses cercanas de las líneas EMT línea 7, EMT línea 15, EMT línea 17, EMT circular C1 y EMT circular C2. Próximo a Banco Santander, Unicaja Banco, BBVA y Bankia. \nLlámanos si necesitas aclarar algo o quieres visitarlo. ',3),('LHA1003','Chalet independiente con piscina, situado en El Atabal, zona residencial compuesta en su mayoría de chalets independientes ajardinados, perteneciente al distrito del Puerto de la Torre. El Atabal tiene su propia historia como barrio, fácil acceso en coche y líneas de transportes de la  EMT: N4, línea 21 y M250, rodeado de todas las infraestructuras necesarias para la vida diaria tanto comercios como establecimientos o centros públicos. A escasos metros se encuentra el famoso Colegio El Atabal.\nLa casa tiene un porche de entrada y un vestíbulo en la primera planta desde el que se accede a los distintos compartimentos. El salón comedor es independiente, muy luminoso y amplio, que da acceso a una terraza con vistas a la piscina. La cocina tiene mucha luminosidad y también tiene espacio para comer. Posee dos baños, un aseo y 4 dormitorios.\nDespués está la planta sótano que actualmente la tienen com taller artístico, y tiene muchas más posibilidades.\nDe construcción meticulosa, robusta y con muchos detalles que hacen que la propiedad sea única y con un encanto especial. Su situación en la urbanización la caracteriza con ciertos privilegios de vistas, orientación y tranquilidad frente al resto de sus vecinos.\nLlámenos si necesita más información.',3),('LHA1004','Piso situado en la barriada Santa María de Betania, zona del Camino de San Rafael. El colegio público San Rafael se encuentra a escasos metros, tiene varios supermercados cercanos como Mercadona y Maskom; autobuses de la línea EMT 4, y línea EMT 24, etc. , que le facilitan el desplazamiento por la ciudad. Barrio con todas las facilidades, comercios y necesidades que se puedan desear.\n El piso está situado en una cuarta planta sin ascensor. Está bien conservado y tiene una buena distribución. Consta de salón con balcón cerrado, cocina, baño y tres dormitorios.\nLlámanos para resolver cualquier duda o visitarlo. Es una gran oportunidad. ',3),('LHA1007','Tranquilidad. Vistas despejadas, espacio, es lo que encontrará en este  magnífico chalet adosado de esquina con dos patios y terraza en la urbanización del Camino de San Alberto. Consta de sótano y tres plantas. En la entrada tiene un bonito patio con plantas y una escalerita de acceso a la vivienda. En la planta principal hay un vestíbulo, un baño con ducha, la cocina cuadrada amueblada con muebles rústicos y un salón comedor bastante amplio, en el que disfrutará del calor acogedor de su chimenea. Desde el salón se accede a un gran patio provisto de barbacoa y zona para comer, ideal para disfrutar del sol de Málaga en buena compañía. En la primera planta están los tres dormitorios y un baño con bañera. En la segunda planta tienen un gran despacho o zona de estudios con muchas posibilidades y una terraza con vistas despejadas. En la planta sótano hay una zona de trastero y aparcamiento.\nLa zona es muy tranquila y está bien comunicada. Justo al lado hay una parada del autobús circular de la EMT línea C7. También está cercano, a menos de un kilómetro de un supermercado DIA, o del CEIP Severo Ochoa o el IES Carlinda. Enfrente del chalet hay una zona amplia de aparcamiento.\nNo dudes en llamar para resolver cualquier duda o visitarlo. Gracias.',3),('LHA1008','Piso amplio, con mucha luz, muy bien cuidado, apto también para matrimonio con hijo, zona tranquila y de gran tránsito, cerca de todas las comodidades, ayuntamiento, ambulatorio, bancos, supermercados, tiendas de barrio.\nEl piso busca una familia, pareja o single, que les guste disfrutar y valorar las cosas, sean cuidadosos en los detalles.\n Se estudian ofertas, siempre que sean coherentes, damos todas la facilidades sobre las peticiones o deseos que nos puedan hacer referente al apartamento.\n\nIMPORTANTE: Tiene plaza de aparcamiento junto a puerta de acceso al inmueble, ideal para que las grandes compras no se hagan muy pesadas.\nTambién está en alquiler en 800 eur. al mes, incluyendo la plaza de aparcamiento.\nSolicitamos que nos entreguen un estudio de solvencia o certificado de deuda en caso de alquiler.',3),('LHA1009','El local que necesitas para empezar tu nuevo negocio.\nTiene 33 metros cuadrados, situado en el Puerto de la Torre frente al colegio público Fuente Alegre en una zona con gran paso de vehículos. Dispone de suministros de agua y electricidad, y fibra óptica para poder contratar internet de alta velocidad. El local tiene un pequeño aseo con WC y lavabo. Anteriormente era un asador de pollos con gran activo de clientes.\nEstá a sólo un kilómetro del campo de fútbol del Puerto de la Torre y del centro de salud, y a 600 m. del banco BBVA, y de las paradas de autobús de la EMT línea 21, línea 62 y línea N4.\n\nNo dudes en llamarnos para resolver cualquier duda.',3),('LHA1010','Casa unifamiliar en parcela de 2200 m2, de los que 1900 están diáfanos y 300 m2 de huerto. La planta primera tiene 4 dormitorios, un cuarto de baño, salón, cocina, hall de entrada con pequeña alacena y pasillo central.\nEn la planta alta hay una habitación grande de 51 m2 y una gran terraza a la que se accede por escalera exterior. La planta baja está diáfana y se usa como garaje. Tiene fosa séptica y pozo propio, aunque también tiene cometida de agua municipal.\nAcceso a la finca por carretera A-7001, y a 4 minutos de la estación ITV del Palo y a unos 1,70 Km. de distancia.\nNo dudes en llamar para resolver cualquier duda o visitar.',3),('LHA1012','Vivienda en primera planta, habilitada en dos apartamentos, completamente amueblado, cada apartamento con acceso propio. \nApartamento nº1 con gran salón, cuarto de baño, amplia cocina, un dormitorio matrimonio y otro dormitorio amplio con ventana balcón, muy luminoso y coqueto. \nApartamento nº2 con hall de entrada, salón muy luminoso con grandes ventanales y vistas a la Sierra de la Nieves, cuarto de baño, cocina y dos dormitorios amplios.\n Situado en el pueblo de Yunquera, maravilloso municipio lleno de magia y fantasía.\nLLámenos para más información.',3),('LHA1014','Magnífico piso en la calle San Martín. A escasos metros encontrará tiendas, farmacia, bares y negocios locales de alimentación para tener todo a mano. También podrán disfrutar de las pistas deportivas, parque infantil y circuitos biosaludables para mayores pertenecientes a la mancomunidad. , así como el parque de skater que se encuentra también muy cercano. Hay una parada de autobús de la línea 38 de la EMT para ir al centro de Málaga. También está cerca del hospital Carlos de Haya.\nEl piso se encuentra en muy buen estado, en una quinta planta (la última) de un edificio con ascensor. Tiene tres dormitorios, dos de ellos con armarios empotrados, salón con balcón con vistas despejadas y baño con bañera.\nTiene suelos de gres, aire acondicionado y ventanas de doble acristalamiento, con mosquiteras. Se vende con muebles y electrodomésticos.\n',3),('LHA1015','Luz, tranquilidad, vistas espectaculares y una buena situación es lo que le ofrecemos con este piso de tres dormitorios en una 13ª planta. Se encuentra en una zona con mucha proyección, donde acaban de inaugurar un precioso parque y muy próximo a las dos torres (edificios rascacielos modernos en construcción). Está muy cerca de un nuevo supermercado Mercadona, del estadio de fútbol la Rosaleda del Málaga CF. Situado a 350 m. del centro comercial y de ocio Rosaleda, donde podrá encontrar tiendas, cines, restaurantes, etc. , muy cerca de la Escuela Oficial de Idiomas, el diario SUR de Málaga y a 1 kilómetro y medio del centro histórico de Málaga. Paradas de autobuses de la EMT como las líneas 15, 17 o N2 muy cercanas, y su fácil acceso a la autovía lo hacen estar en un enclave muy bien comunicado.\nEl piso consta de tres dormitorios exteriores, un baño con bañera, salón con balcón y cocina. Se vende amueblado y con electrodomésticos. El edificio tiene un gran portal y tres ascensores, y hay un conserje.\nEs ideal como inversión. Consúltenos todas su dudas, estaremos encantados de resolvérselas y concertar una visita si le interesa. Gracias.',3),('LHA1016','Piso en edificio situado a 300 m. de la playa y paseo marítimo, junto al Parque del Chiquito y el Parque del Oeste donde se encuentran pistas deportivas, parques infantiles, circuitos biosaludables, zona para pasear, lagos, animales, etc. La zona además cuenta con muchos comercios, bares y restaurantes cercanos, banco Santander, Unicaja Banco, el IES Emilio Prados y Litoral, CEIP Paulo Freire, y en definitiva todo lo que pueda necesitar está a mano. A unos metros del portal está la parada de autobús de las líneas EMT 15 y 7.\nEl piso es exterior, originariamente era de 4 dormitorios, pero uno de ellos lo usaron para aumentar el tamaño de la cocina, que ha incluido zona de comedor. Tiene dos baños, uno con ducha y otro con bañera, salón con balcón bastante amplio y tres dormitorios. Tiene aire acondicionado, y doble acristalamiento en las ventanas.\nEl aparcamiento está incluido en zona descubierta comunitaria, teniendo cada vecino una plaza asignada. El edificio tiene dos portales de entrada, uno por la calle y el otro por la zona de aparcamiento.\nSi tiene cualquier duda no dude en contactar, estaremos encantados de atenderle y concertar una visita.',3),('LHA1017','El sol de Torremolinos, la tranquilidad, la esencia de su gente es lo que vas a percibir con este precioso apartamento de un dormitorio y patio en un primer piso de un edificio moderno.\nSe encuentra entre el centro de Torremolinos y el genuino barrio del Calvario. Está ubicado en la mejor zona, ya que tiene las ventajas de vivir prácticamente en el centro de Torremolinos cerca de todas las comodidades: Ayuntamiento de Torremolinos, ambulatorio San Miguel, bancos, supermercados, tiendas, restaurantes, calle San Miguel, por lo que no necesitarás vehículo en tu día a día, pero sin sufrir las desventajas de ello al ser una zona tranquila. La principal estación de tren de cercanías para ir a Málaga o Fuengirola está a cinco minutos a pie.\nTiene un salón amplio con cocina americana con su placa vitrocerámica y nevera, un baño con ducha y un dormitorio amplio con un gran armario empotrado y acceso al patio de uso exclusivo de la vivienda, donde podrás relajarte al aire libre o comer con amigos, . \nEs ideal para una o dos personas,\nSuministros de electricidad y agua a cargo del arrendatario.\nNo se admiten mascotas.',3),('LHA1018','El sol, la playa, el olor a mar, la tranquilidad, todo eso te ofrece este magnífico piso de cuatro dormitorios en una de las zonas más privilegiadas de Málaga. Situado junto al Paseo marítimo Antonio Banderas y la popular Torre Mónica, el parque El Chiquito, y a escasos metros del Parque del Oeste hacen que su ubicación sea uno de los atractivos de esta propiedad. Lo tendrás todo a mano: A 200 m. del Banco Santander, 130 m. de Supermercados MAS, 500 m. del IES Emilio Prados y cerca de numerosos restaurantes para todos los gustos, se encuentra muy bien comunicado. Para moverte en transporte público también están las paradas de la EMT de las líneas 7, 15, y 40 a escasos metros. A pesar de ser una zona con mucha vida, también es muy tranquila, al encontrarse el edificio rodeada de parque y zona peatonal.\nEs un piso de esquina, de dos vecinos por planta. Se compone de una gran cocina amueblada, salón con acceso a una estupenda terraza desde donde se divisa el mar, cuatro dormitorios, el principal con un gran ventanal y acceso a uno de los baños, completo y con ducha. El otro baño tiene bañera. \nTodas las ventanas son de doble acristalamiento, los suelos de mármol, y tiene aire acondicionado centralizado.\nEstán incluidos en el precio un trastero de unos 7 m y una plaza de aparcamiento en garaje.\nLlámanos si tienes alguna duda, estaremos encantados de atenderte.',3),('LHA1019','Junto al río Guadalmedina, en el genuino barrio del centro de Málaga El Molinillo, se encuentra este piso de tres dormitorios. Todo lo que necesite lo tendrá a mano: cerca del mercado de Salamanca, supermercados DIA, colegio San Juan de Dios, a 15 minutos a pie de la Plaza de la Constitución y a 180 m. de las paradas de autobús de las líneas de la EMT 2, 20 y 30.\n Está en la primera planta de un edificio con el portal reformado y con ascensor, aunque hay que subir algunos peldaños para acceder a la vivienda. El suministro de agua está incluido en los gastos de comunidad.\nSe compone de salón, cocina, baño con ducha y tres dormitorios, dos de ellos se encuentran comunicados por una puerta. Necesita reforma, pero tiene muchas posibilidades.\nTiene la servidumbre de un patio comunitario a compartir con otro vecino.\nEs un piso que tiene un algo especial, si quiere visitarlo o desea más información no dude en llamarnos.',3),('LHA1020','Local de 47 m2, completamente a reformar, con muchas posibilidades. Está situado en la planta semisótano de la urbanización Cortijo de Bazán en Ciudad Jardín. Consta de un baño y una especie de buhardilla superior a la que se accede por una escalera. El suministro de agua es comunitario. Zona tranquila, ya que no da directamente a la carretera. Se encuentra a menos de 50 m. de un supermercado Dia, y a a la misma distancia de una farmacia. Muy próximo a la parada de autobús de la línea EMT 20. A 6 minutos del mercado Emilio Thuiller y a media hora del centro de Málaga.',3),('LHA1021','Piso situado en la Zona de Haza del Campillo, entre Camino de Suarez, nueva Málaga y Gamarra, frente al Colegio Virgen Inmaculada Santa Mª de la Victoria, cerca de Supermercados MAS, Mercadona y DÍA, múltiples guarderías de gran calado y todos lo tipos de comercios que te hacen una vida muy amena, una zona de paso muy frecuentada en un vecindario de los que hoy en día no encuentras.\nBien comunicado, a pocos metros de paradas de autobuses de la EMT líneas 7, 18, 15, y las circulares C1 y C2, así como de un carril bici que pasa justo por la puerta del inmueble. El piso está bien conservado, con buena ventilación. El dormitorio principal y el salón dan a una calle trasera tranquila por la poca afluencia de vehículos. Es un primero sin ascensor.',3),('LHA1022','Tranquilidad, paz, amplitud, bonitas vistas a la naturaleza, el sol de Málaga. Todo eso es lo que te ofrece esta casa de tres dormitorios, en la urbanización Cortijo de Mazas.\n Es un conjunto con mucho encanto en un lugar privilegiado donde disfrutar de la paz del campo a escasos minutos de la zona urbana en Torremolinos o Churriana. Justo enfrente tiene la parada de autobus de la EMT C8 que le llevará a Churriana. A tres minutos en coche de supermercados como Aldi, Lidl o Maskom, 4 minutos del IES Playamar o los CEIP Benyamina o Atenea.\nSe vende la vivienda 1 de un conjunto de tres casas. Esta se divide en dos plantas. La entrada principal se encuentra en la planta de arriba, a la que se accede por unas escaleras. Aquí se encuentra el gran salón comedor con ambientes separados y acceso a la terraza en la que disfrutará de unas vistas impresionantes. también está la amplia cocina y un aseo.\nEn la planta inferior se encuentra un distribuidor hacia los tres dormitorios y dos baños, uno de ellos equipado con ducha y bañera. En esta misma planta se encuentra una cocina-office con acceso al jardín exterior privativo. Al otro lado se encuentra una terraza cubierta de 51 m2.\nAdemás, en la planta sótano se encuentra el garaje común, en el que se encuentra su plaza de aparcamiento, y 2 trasteros, unos de 9m2 y otro de 10m2.\nContáctanos para más información, estaremos encantados de atenderte.',3),('LHA1023','Se vende piso en tercera planta y magnífico ático en cuarta planta a reformar con posibilidad de convertirlo en dúplex. Están situados en el barrio de la Trinidad, en el centro de Málaga, junto al río Guadalmedina. El ático se compone de un dormitorio, un baño cocina y salón. También posee un porche techado y una magnífica terraza de 68 m2. El piso del tercero se compone de cuatro dormitorios tipo matrimonio, cocina, dos baños y un aseo, salón amplio y balcón a calle principal. Todo exterior. La propiedad posee zonas comunes de acceso para todos los vecinos, con ascensor que cubre desde la planta baja hasta la tercera planta y un pequeño tramo de escaleras desde esta planta al ático. El suministro de agua es comunitario, Tiene gas ciudad instalado y calle habilitada con fibra óptica para internet de gran velocidad. Situado a 270 m. de supermercado Mercadona, a 286 m. de la Plaza Bailén, y 400 m. del Hospital Civil. Paradas de autobuses cercanas de las líneas EMT línea 7, EMT línea 15, EMT línea 17, EMT circular C1 y EMT circular C2. Próximo a Banco Santander, Unicaja Banco, BBVA y Bankia.',3),('LHA1024','Casa rural reformada de 90m2, en una parcela de 2.500m2, tiene 2 dormitorios, 1 baño con ducha, un amplio salón con un chimenea, piscina al exterior bien acondicionada y una terraza grande con unas vistas extraordinarias al paraje natural.\nCasita en muy buen estado, todo reformado.\nLa casa tiene una vista de 360º maravillosa: en donde se puede observar todo el entorno de Ardales, cerca del famoso Caminito del Rey, Pantano del Chorro y todo ese maravilloso paisaje y naturaleza que resurge de este lugar tan bello y mágico.\n\nVER UBICACIÓN \n\nDistancias (todo en carretera asfaltada):\n8 minutos al pantano Tajo de la Encantada\n16 minutos hasta la Estación de Tren El Chorro\n20 minutos hasta el pantano de el Chorro\n20 minutos hasta salida autovía ARDALES MA-442\n23 minutos hasta Ardales Pueblo\nSolo hay 4 minutos de carril  desde la salida de la carretera  MA-448 hasta la maravillosa casa.\nGracias por su atención',3),('LHA1025','Sol, ambiente familiar, tranquilidad, el tenerlo todo a mano. Todo eso encontrará en este bonito piso en la urbanización \"Balcón de Miraflores\". Tiene todo a su alcance: el centro de salud de Carlinda a 200 m. , un supermercado Día Plaza a solo 100 m. , la parada de autobús del circular C6 de la EMT, el IES Carlinda a 300 m. y un McDonalds a 150 m.\nEl piso tiene los suelos de madera, ventanas de doble acristalamiento, aire acondicionado, hilo musical, y se encuentra en perfecto estado de conservación.\nConsta de entrada, cocina con todos los electrodomésticos, muebles y encimera de Silestone y lavadero. El salón es amplio y luminoso. Tiene aire acondicionado, y da a una bonita terraza con toldos desde donde se divisa la zona infantil con columpios, la piscina y los jardines.\nEl dormitorio principal tiene hilo musical, aire acondicionado y un baño con ducha. El piso posee dos dormitorios más, con armarios empotrados y ventanas a la calle de atrás, que es muy tranquila.\nEstán incluidos en el precio una plaza de aparcamiento y un trastero.\nNo dude en contactar si tiene cualquier duda o desea concertar cita para visitarlo. Gracias.',3),('LHA1026','Piso a reformar de 67m2, situado en Avda. Velázquez 51 justo frente al antiguo Bingo El Torcal,  Barriada Haza Honda con parada de Autobús EMT 3,9,10,22,27,31 y N1 y Parada de Metro \"El Torcal\" , con vistas a calle Giuseppe Micael.\nPiso consta de  2  dormitorios, cuarto de baño, cocina-lavadero, Habitación Guardarropa y salón bastante iluminado.',3),('LHA1028','Ambiente urbano, a la vez que tranquilidad es lo que se percibe en este coqueto piso situado en la calle Lagunillas, en el singular barrio de la Victoria, en la zona de la Plaza de la Merced.\nParalela a la conocida calle Victoria, muy cerca del mercado de la Merced, el Museo Picasso, el teatro Cervantes, su enclave es uno de los atractivos de este inmueble para disfrutar de todo lo que ofrece el centro de Málaga: su oferta cultural, gastronomía, ocio, tradiciones, así como su clima y su playa.\nEl piso consta de un salón comedor amplio y luminoso, con vista despejada a la plaza Miguel de los Reyes, y cocina americana con electrodomésticos. Tiene un baño completo con ducha y bidet, y dos dormitorios. El piso cuenta con aire acondicionado y calefacción centralizada, paredes lisas, todo en buen estado y el espacio muy bien distribuido.\nEl edificio tiene ascensor, aunque hay que subir unos cuantos escalones para acceder a él, pero dispone de una silla elevadora para salvar ese tramo. \nLa terraza comunitaria es de uso de los propietarios.\nEs una zona con un proyecto de regeneración por parte del Ayuntamiento de Málaga en el que están previstas medidas para potenciar la su uso peatonal, incluir más zonas verdes y equipamientos públicos.\nIMPORTANTE: Usted no paga honorarios a la inmobiliaria.\nSi necesita más información o quiere verla no dude en contactar con nosotros.',3),('LHA1029','En la Urbanización Las Velas, zona de la Cañada de los Cardos en Torremolinos, se encuentra este encantador chalet independiente con una ubicación estratégica que brinda accesos directos desde la autovía, carretera nacional o comarcal. Disfruta de la tranquilidad de este entorno, estando cerca de todo sin sufrir la masificación de coches y personas. A tan solo 5 minutos de la playa, Plaza Mayor, centro comercial (IKEA-LEROY MERLIN-CONFORAMA), aeropuerto, centro de Torremolinos y Palacio de Congresos, entre otros.\n\nConstruido en el año 2007, esta propiedad cuenta con 319 m² construidos y 282 m² útiles distribuidos en una primera planta con salón con chimenea, cocina con acceso a un  porche, lavadero, un dormitorio y un baño. En la planta superior se encuentra el dormitorio principal con vestidor y baño, y acceso a una terraza con vistas a la montaña y al mar. También hay otros dos dormitorios con amplios armarios empotrados y otro cuarto de baño. Sótano con espacio para dos o tres vehículos, trastero y pequeña oficina. Piscina privada. Amplias ventanas de aluminio color madera oscilo batientes. Placas solares para el agua caliente.\nCon orientación suroeste, en una parcela de 428 m², este chalet independiente te ofrece la calidad de vida que buscas. ¡No dejes pasar esta oportunidad de adquirir tu hogar ideal en Torremolinos!',3),('LHA1030',NULL,3);
